import React, { Component } from 'react';
import "./css/header.css"

export default class Header extends Component {

    render() {
        return (
        <header className="flex-horizontal space-between background-dark">
            <div className="title">MUHAMMAD NOMAN</div>
            <div className=".fa-menu"></div>
        </header>)
        

    }
}
